import React from "react";
import './App.scss';
import {connect} from "react-redux";
import Article from "./article-component";

class ArticleListComponent extends React.Component {
    constructor(props) {
        super ( props );
    }

    render() {
        console.log(this.props.men);
        var articles=[];
        function returnArticle(item){
            articles.push(
                <Article
                    name = {item.name}
                    color = {item.color}
                    price = {item.price}/>
            )
            console.log(<Article
                name = {item.name}
                color = {item.color}
                price = {item.price}/>)
        }
        var allArticles =  this.props.men.map(returnArticle());
        console.log('allArticles');
        console.log(allArticles);
        return (
            {articles}
            )
    }
}

const mapStateToProps = (state) => {
    return ({
        men : state ? state.men : '' ,
        women : state ? state.women : '' ,
    });
};
export const ArticleList = connect ( mapStateToProps) ( ArticleListComponent );
